core::iter::IntoIterator::into_iter.doc:
Creates an iterator from a value.

See the [module-level documentation] for more.

[module-level documentation]: crate::iter

# Examples

```
let v = [1, 2, 3];
let mut iter = v.into_iter();

assert_eq!(Some(1), iter.next());
assert_eq!(Some(2), iter.next());
assert_eq!(Some(3), iter.next());
assert_eq!(None, iter.next());
```

core::iter::Iterator::next.doc:
Advances the iterator and returns the next value.

Returns [`None`] when iteration is finished. Individual iterator
implementations may choose to resume iteration, and so calling `next()`
again may or may not eventually start returning [`Some(Item)`] again at some
point.

[`Some(Item)`]: Some

# Examples

```
let a = [1, 2, 3];

let mut iter = a.into_iter();

// A call to next() returns the next value...
assert_eq!(Some(1), iter.next());
assert_eq!(Some(2), iter.next());
assert_eq!(Some(3), iter.next());

// ... and then None once it's over.
assert_eq!(None, iter.next());

// More calls may or may not return `None`. Here, they always will.
assert_eq!(None, iter.next());
assert_eq!(None, iter.next());
```

core::ptr::copy_nonoverlapping.doc:
Copies `count * size_of::<T>()` bytes from `src` to `dst`. The source
and destination must *not* overlap.

For regions of memory which might overlap, use [`copy`] instead.

`copy_nonoverlapping` is semantically equivalent to C's [`memcpy`], but
with the source and destination arguments swapped,
and `count` counting the number of `T`s instead of bytes.

The copy is "untyped" in the sense that data may be uninitialized or otherwise violate the
requirements of `T`. The initialization state is preserved exactly.

[`memcpy`]: https://en.cppreference.com/w/c/string/byte/memcpy

# Safety

Behavior is undefined if any of the following conditions are violated:

* `src` must be [valid] for reads of `count * size_of::<T>()` bytes.

* `dst` must be [valid] for writes of `count * size_of::<T>()` bytes.

* Both `src` and `dst` must be properly aligned.

* The region of memory beginning at `src` with a size of `count *
  size_of::<T>()` bytes must *not* overlap with the region of memory
  beginning at `dst` with the same size.

Like [`read`], `copy_nonoverlapping` creates a bitwise copy of `T`, regardless of
whether `T` is [`Copy`]. If `T` is not [`Copy`], using *both* the values
in the region beginning at `*src` and the region beginning at `*dst` can
[violate memory safety][read-ownership].

Note that even if the effectively copied size (`count * size_of::<T>()`) is
`0`, the pointers must be properly aligned.

[`read`]: crate::ptr::read
[read-ownership]: crate::ptr::read#ownership-of-the-returned-value
[valid]: crate::ptr#safety

