            let ranges = self.nonoverlapping_ranges(src, dst, count, new_head);
            for (src, dst, count) in ranges {
                ptr::copy_nonoverlapping(src, dst, count);
            }
        }

        // SAFETY:
        // - The elements were just initialized by `copy_nonoverlapping`
        self.head = new_head;
        self.len += count;
    }

